- input: "TEXT\x1CC00031054\x1CTEXT-00001\x1C\x1CF3XA\x1CDue to a database error,
    the committee did not itemize $41,250 in contributions that should have been itemized.
    The report has been amended to itemized these contributions. The committee did
    not accept excessive contributions from the individuals listed in the Commission's
    letter.  Contributions were incorrectly attributed to the records of these individuals
    and others but should have been reported as unitemized contributions.  The committee
    has amended its report to disclose the contributions as unitemized receipts. We
    returned $5000 from UA Plumbers and Pipefitters on 4/29/2014. The check has not
    yet cleared the bank. We will provide a copy once it has.  On January 30, 2014,
    we transferred $2329.58 from our federal account to our non-federal account to
    correct an error of for items that should have been paid with all federal funds
    but were orginaially included in a federal/non-federal transfer. This will appear
    on our next report. On January 30, 2014 we transferred $951.28 from our federal
    account to our non-federal account to correct an error for a check that was voided
    that was originally inlcuded on a federal/non-federal transfer. This will appear
    on our next report. On January 31, 2014 we transfered $35.52 for a voided check
    that was included on a federal/non-federal transfer. This will appear on our next
    report. The payments for rent are for our nightly bingo games which are required
    under State law not reimbursement to the non-federal account. Rent for our nightly
    bingo games is assessed at the usual and normal charge. The maximum allowable
    rents are set by the State of Michigan Charitable Gaming Division of the Michigan
    Lottery based on requirements of the bingo hall. We pay the maximum rent allowable
    by the Charitable Gaming Division. All salaries and fringe benefits for this month
    reported on Schedule H4 are paid on employees who spent less than 25% of their
    time during this month on FEA\n"
